import React from 'react';
import Marquee from 'react-marquee-master';

function Lists() {

    const marqueeItems = ['One', 'Two', 'Three'];
    return (<div height='1030px' className='fixed-bottom'><Marquee direction='up' marqueeClassName='bg-warning' minHeight='250' marqueeItems={marqueeItems} /></div>) 
}

export default Lists;
